01.typescript-in-5-minutes.html.body:
类型注解
function greeter(person: string) {
    return "Hello, " + person;
}

接口
interface Person {
    firstName: string;
    lastName: string;
}

function greeter(person: Person) {
    return "Hello, " + person.firstName + " " + person.lastName;
}

类
class Student {
    fullName: string;
    constructor(public firstName, public middleInitial, public lastName) {
        this.fullName = firstName + " " + middleInitial + " " + lastName;
    }
}

interface Person {
    firstName: string;
    lastName: string;
}

function greeter(person : Person) {
    return "Hello, " + person.firstName + " " + person.lastName;
}

let user = new Student("Jane", "M.", "User");

document.body.innerHTML = greeter(user);

注意
这里的类和 ES6 的类有些许差别

支持在 constructor 外定义属性
在 constructor 定义的 public 属性会自动成为该类的公有属性（这里还可以为 private、protected）

所以这里的 Student 在实例化成 user 后拥有 4 个属性如下
user; // {fulName: "Jane M. User", firstName: "Jane", middleInitial: "M.", lastName: "User"}

02.basic-types.html.body:
布尔值
let isDone: boolean = false;

数字
let decLiteral: number = 6;

字符串
let str: string = 'test';

数组
这里有两种定义方法
// 方法一
let arr: number[] = [0, 1, 2];

// 方法二
let arr: Array = [0, 1, 2];

定制数组(官方翻译作：元组)
let x: [string, number];
// Initialize it
x = ['hello', 10]; // OK
// Initialize it incorrectly
x = [10, 'hello']; // Error

注意
当访问一个越界的元素时，会使用联合类型进行处理（如上面例子里，越界的元素类型为 string|number）
x[3] = 'world'; // OK, 字符串可以赋值给(string | number)类型

console.log(x[5].toString()); // OK, 'string' 和 'number' 都有 toString

x[6] = true; // Error, 布尔不是(string | number)类型

枚举
enum Color {Red, Green, Blue}
let c: Color = Color.Green;

默认情况下，枚举值从 0 开始，这里 Green 的值则为 1
也可以指定枚举值
enum Color {Red:1, Green, Blue}; // 从 1 开始，因此 Green=2，Blue=3

enum Color {Red:1, Green:2, Blue:4};

我们也可以根据枚举值得到定义的名字
enum Color {Red:1, Green, Blue}; // 从 1 开始，因此 Green=2，Blue=3

console.log(Color[2]); // Green

任意类型 any
定义为 any 的变量可以被赋值为任何类型的内容
let notSure: any = 4;
notSure = "maybe a string instead";
notSure = false;

Never
永远都不应该出现的类型，当他出现时，则表示代码存在问题，编译会失败
// 返回never的函数必须存在无法达到的终点
function error(message: string): never {
    throw new Error(message);
}

// 推断的返回值类型为never
function fail() {
    return error("Something failed");
}

// 返回never的函数必须存在无法达到的终点
function infiniteLoop(): never {
    while (true) {
    }
}

类型断言
程序员有时候会比程序更知道当前的 any 是什么类型，这里可以直接告诉 typescript
let someValue: any = "this is a string";

let strLength: number = (someValue).length;

// 另一种写法
let strLength: number = (someValue as string).length;

03.interface.html.body:
定义新的数据结构类型
interface LabelledValue {
  label: string;
  width: number;  可选类型
  [_:string]: any;  未知属性 未知类型（官方叫做索引签名）
  readonly y: number;  只读属性，只能赋值一次
}

function printLabel(labelledObj LabelledValue) {
  console.log(labelledObj.label);
}

只读属性
interface 可以定义只读属性（readonly）。
同时，typescript 也提供了一种新的数据类型：ReadonlyArrayT，此类型的数组将在定义后不能添加、修改数组元素
let a number[] = [1, 2, 3, 4];
let ro ReadonlyArraynumber = a;
ro[0] = 12; // error!
ro.push(5); // error!
ro.length = 100; // error!
a = ro; // error!

函数类型
interface 除了定义普通对象外，还能定义函数
interface SearchFunc {
  (source: string, subString: string) boolean;
}

let mySearch SearchFunc;
mySearch = function(source string, subString string) {
  let result = source.search(subString);
  return result > -1;
}

注意
这里定义的函数，参数可以少，但不能多。
如果我们的函数是不定个数参数的怎么办？typescript 提供了 ES6 spread 方案
interface Add {
  (str: string, ...args: any[]): number;
}

let add Add;
add = function (str, a, b) {
  console.log(str)
  console.log(a, b);
}

索引签名
在一开始的例子里有索引签名的例子：
interface LabelledValue {
  [_:string]: any;  未知属性 未知类型（官方叫做索引签名）
}

注意

这里的 _ 只是作占位用，并不表示具体的属性名，因此可以填“任意”内容。

索引签名支持 string 和 number 两种格式

如果将 any 改成指定格式，则显示定义的属性也需要是该指定属性，如下
interface LabelledValue {
  [_:string]: string;  未知属性 未知类型（官方叫做索引签名）
  a: string; // correct
    b: number; // error
}



